import React, { Component } from 'react';
import './view/css/bootstrap.css';
import './view/css/main.css';
import './view/css/font-awesome.css';
class App extends Component {
  render() {
    return (
      <div class="App">
      <header class="App-header">
        <div class="col-3" >
            <input type="text" class="form-control form-rounded text-center" placeholder="What's your name"/>
            <button type="button" class="col-6 btn btn-info form-rounded">Join</button>
          </div>
        </header>
      </div>
    );
  }
}

export default App;
